export const setUsername = (username) => {
  return (dispatch) => {
    dispatch({
      type: "newuser",
      payload: username,
    });
  };
};

export const addMisstake = (amount) => {
  return (dispatch) => {
    dispatch({
      type: "INCREMENT",
      payload: amount,
    });
  };
};

export const resetMisstakes = () => {
  return (dispatch) => {
    dispatch({
      type: "RESET",
      payload: "",
    });
  };
};

export const resetGuess = () => {
  return (dispatch) => {
    dispatch({
      type: "RESET",
      payload: "",
    });
  };
};

export const addGuess = (guess) => {
  console.log(guess);
  return (dispatch) => {
    dispatch({
      type: "CORRECT",
      payload: guess,
    });
  };
};

export const addQuote = (quote) => {
  return (dispatch) => {
    dispatch({
      type: "newQuote",
      payload: quote,
    });
  };
};
